EDITORCODE.Data:
/* Assuming the variables Beverages, Canned, Income, Internet, Others, and Perishables are already defined */

/* Define the minimum and maximum values for each variable */
%let Beverages_Min = -289.5637499999999;
%let Beverages_Max = 6300.0;
%let Canned_Min = -660.6175000000001;
%let Canned_Max = 9500.0;
%let Income_Min = -2342.6187499999987;
%let Income_Max = 90815.12156559406;
%let Internet_Min = .; /* NaN (Not a Number) */
%let Internet_Max = 100.0;
%let Others_Min = -577.4174999999999;
%let Others_Max = 7000.0;
%let Perishables_Min = -575.2153124999999;
%let Perishables_Max = 12600.0;

/* Transform the values exceeding the minimum and maximum values */
Beverages = min(max(Beverages, &amp;Beverages_Min), &amp;Beverages_Max);
Canned = min(max(Canned, &amp;Canned_Min), &amp;Canned_Max);
Income = min(max(Income, &amp;Income_Min), &amp;Income_Max);
Internet = min(max(Internet, &amp;Internet_Min), &amp;Internet_Max);
Others = min(max(Others, &amp;Others_Min), &amp;Others_Max);
Perishables = min(max(Perishables, &amp;Perishables_Min), &amp;Perishables_Max);

/* Assuming the variables Beverages, Perishables, Canned, Frozen, Others, and PositiveAllLoB are already defined */

/* Calculate the value of AllLoB */
AllLoB = Beverages + Canned + Frozen + Others + Perishables;

/* Check if AllLoB is less than 0 */
if AllLoB &lt; 0 then do;
    BeveragesPercentage = Beverages / -AllLoB;
    PerishablesPercentage = Perishables / -AllLoB;
    CannedPercentage = Canned / -AllLoB;
    FrozenPercentage = Frozen / -AllLoB;
    OthersPercentage = Others / -AllLoB;
    
    /* Check if Beverages is greater than 0 */
    if Beverages &gt; 0 then BeveragesPercentage = 1 + BeveragesPercentage;
    
    /* Check if Canned is greater than 0 */
    if Canned &gt; 0 then CannedPercentage = 1 + CannedPercentage;
    
    /* Check if Frozen is greater than 0 */
    if Frozen &gt; 0 then FrozenPercentage = 1 + FrozenPercentage;
    
    /* Check if Others is greater than 0 */
    if Others &gt; 0 then OthersPercentage = 1 + OthersPercentage;
    
    /* Check if Perishables is greater than 0 */
    if Perishables &gt; 0 then PerishablesPercentage = 1 + PerishablesPercentage;
end;
else do;
    BeveragesPercentage = Beverages / AllLoB;
    PerishablesPercentage = Perishables / AllLoB;
    CannedPercentage = Canned / AllLoB;
    FrozenPercentage = Frozen / AllLoB;
    OthersPercentage = Others / AllLoB;
    
    /* Check if Beverages is less than 0 */
    if Beverages &lt; 0 then BeveragesPercentage = -1 + BeveragesPercentage;
    
    /* Check if Canned is less than 0 */
    if Canned &lt; 0 then CannedPercentage = -1 + CannedPercentage;
    
    /* Check if Frozen is less than 0 */
    if Frozen &lt; 0 then FrozenPercentage = -1 + FrozenPercentage;
    
    /* Check if Others is less than 0 */
    if Others &lt; 0 then OthersPercentage = -1 + OthersPercentage;
    
    /* Check if Perishables is less than 0 */
    if Perishables &lt; 0 then PerishablesPercentage = -1 + PerishablesPercentage;
end;

/* Apply transformation based on minimum and maximum values */
BeveragesPercentage = max(-0.45147552330713925, min(0.601240823587595, BeveragesPercentage));
CannedPercentage = max(-0.15191301805600735, min(0.23867393495633463, CannedPercentage));
FrozenPercentage = max(-0.40766704876444365, min(0.9176079500220429, FrozenPercentage));
OthersPercentage = max(-0.19472015031452514, min(0.3875299723741822, OthersPercentage));
PerishablesPercentage = max(-0.047169807077109216, min(0.9609876548888807, PerishablesPercentage));
PositiveAllLoB = max(169.04689108472397, min(215.8257339152759, PositiveAllLoB));
